import * as React from 'react'
import {Button, Select, MenuItem, Box, Modal} from '@mui/material';

export default function NestedModal(props) {
    const [open, setOpen] = React.useState(false);
    const [selectedCoin, setSelectCoin] = React.useState("Select")
    const handleOpen = () => {
      setOpen(true);
    };
    const handleClose = () => {
      setOpen(false);
    };

    const handleChange = (res) => {
        console.log(res)
        setSelectCoin(res)
      }

    const style = props.style
    const coin = props.item
    console.log(coin)
  
    return (
      <div>
        <Button onClick={handleOpen}>+</Button>
        <Modal
          open={open}
          onClose={handleClose}
          aria-labelledby="parent-modal-title"
          aria-describedby="parent-modal-description"
        >
          <Box sx={{ ...style, width: 400 }}>
          <Button 
            value={coin.id} 
            sx={{justifyContent: "space-between", width: "100%", height: "100%"}}
            onClick={(e) => handleChange(e.target.value)}
            >
              {coin.name}
              <img src={`${coin.icon}`} sx={{height: "15px", width: "15px", position: 'absolute'}}/>
            </Button>
          </Box>
        </Modal>
      </div>
    );
  }
